import { Sitemap } from 'Sitemap';

function App() {
  return (
    <>
      <header>
        <h1>Sitemap Searcher</h1>
      </header>
      <div className="main-content">
        <Sitemap />
      </div>
      <footer>
        <small>&copy; { new Date().getFullYear() } Jim Chua</small>
      </footer>
    </>
  );
}

export default App;
